import './Expenses.css';
import './ExpenseItem.css';
import ExpenseItem from './ExpenseItem';
import App from '../App';
// import ExpenseDate from './ExpenseDate';

function Expenses(props) {
	return (
		<div className='expenses'>
			<ExpenseItem title={App.props[0].title} amount={App.props[0].amount} date={App.props[0].date} />
			<ExpenseItem title={App.props[1].title} amount={App.props[1].amount} date={App.props[1].date} />
			<ExpenseItem title={App.props[2].title} amount={App.props[2].amount} date={App.props[2].date} />
			<ExpenseItem title={App.props[3].title} amount={App.props[3].amount} date={App.props[3].date} />
		</div>
	);
}

export default Expenses;
